import styled from "styled-components";
import React from "react";
import ReactDOM from "react-dom";
import "./Company.css";

function Company(props) {
  const { company } = props;
  return (
    <div>
      <img src={company.img} />
      <h2>{company.name}</h2>
      <h2>{company.category}</h2>
      <p>
        {" "}
        {company.ratings} {company.deliveryTime}
      </p>
    </div>
  );
}

export default Company;
